Per descrivere una rete necessario dire:
Quanti ingressi ha;
Quante uscite ci sono;
Quale la sua funzione F (aka descrizione funzionale) che pu essere a parole, descritta tramite Verilog (che un linguaggio di descrizione) o anche tramite le tabelle di verit.

Equivale al prodotto di somme, ovvero tutti or messi in un singolo and;
tutto quello che abbiamo detto per la forma sp pu essere detta anche per la forma PS (forma canonica)
come si studiano le mappe in forma ps:
